<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta http-equiv="X-UA-Compatible" content="IE=edge">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>filter</title>
</head>
<body>
    <script>
        const numbers=[5,10,15,20,25,30,35,40]
        const filterResults=numbers.filter((num)=>
        {
        return (num>10 && num<35)
        }
        )
        document.write(`${filterResults}`)

        filterResults.map((num)=>{
            document.write(`<li>${num}</li>`)
        }
        )
    </script>
</body>
</html>
